INSERT INTO `donacija` (`id`, `ime_donacija`, `opis_donacija`, `email`, `goal`, `potvrda_admin`, `slika`, `adresa`) VALUES
(44, 'Planting a Tree', 'Dormant seasons, the fall after leaf drop and early spring before bud break, are ideal times to plant new trees. Be sure the weather conditions are cool and allow time for new plants to establish roots in the new location before spring rains and summer heat stimulate new top growth. Healthy bailed and burlapped or container trees can be planted throughout the growing season. In areas where trees grow year round, tropical and subtropical climates, any time is a good time to plant a new tree as long as sufficient water is available.', 'stefankrste@yahoo.com', 1428, 1, '', '0x59b035bdd806594541650ce9b8798019c127cbb1');
INSERT INTO `donacija` (`id`, `ime_donacija`, `opis_donacija`, `email`, `goal`, `potvrda_admin`, `slika`, `adresa`) VALUES
(45, 'Educate A Child', 'Educate A Child (EAC), a global programme of the Education Above All Foundation, aims to trigger significant breakthroughs and a material difference in the lives of children who have no access to primary education. EAC has been helping millions of the hardest-to-reach out-of-school children worldwide realize their right to a quality education. ', 'stefankrste@yahoo.com', 800, 0, '', '0x59b035bdd806594541650ce9b8798019c127cbb1');
INSERT INTO `donacija` (`id`, `ime_donacija`, `opis_donacija`, `email`, `goal`, `potvrda_admin`, `slika`, `adresa`) VALUES
(35, 'Clean the Ocean', 'Every year, millions of tons of plastic enter the oceans, of which the majority spills out from rivers. A portion of this plastic travels to ocean garbage patches, getting caught in a vortex of circulating currents. If no action is taken, the plastic will increasingly impact our ecosystems, health, and economies.', 'stefankrste@yahoo.com', 1000, 0, '', '0x59b035bdd806594541650ce9b8798019c127cbb1');
INSERT INTO `donacija` (`id`, `ime_donacija`, `opis_donacija`, `email`, `goal`, `potvrda_admin`, `slika`, `adresa`) VALUES
(48, 'Ending hunger ', 'Ending world hunger is one of the greatest challenges of our times. Across the globe, up to 811 million people do not have enough food and 48.9 million people are facing emergency levels of hunger. Indeed, parts of  Yemen, South Sudan, Ethiopia and Nigeria may be close to or are already in the grip of famine. \r\n\r\nThe consequence of diets poor in vitamins, minerals and other nutrients are affecting the health and life prospects of millions more, and casting a shadow over the future of communities and entire countries.  \r\n\r\nAlthough enough food is produced to feed everyone on this planet, the goal of a world with zero hunger, as set out in the 2030 Agenda for Sustainable Development and specifically in Sustainable Development Goal 2, remains hugely challenging due to a toxic cocktail of conflict, climate change, disasters and structural poverty and inequality. Over the past two years, the socio-economic consequences of the COVID-19 pandemic have further exacerbated the situation by pushing millions of vulnerable people into greater food insecurity and driving up the costs of reaching people in need.', 'stefankrste@yahoo.com', 2500, 0, '', '0x2e94bc94e91aa604c5a30a9647d6a042c93dd71f');
COMMIT;

